import React, { Component } from 'react';
import {Jumbotron, Button, Container, Row} from 'react-bootstrap';

import '../css/bootstrap.css';

class Home extends Component{
  render(){
    return <Container>
      <Row>
          <div></div>
      </Row>
    </Container>
  }
}

export default Home;
